import React, {Component} from 'react';
import axios from "axios";

export default class ViewCourseSubject extends Component {

    constructor(props) {
        super(props);
        this.onClickFindTotalAmount = this.onClickFindTotalAmount.bind(this);
        this.onClickDeleteCourse = this.onClickDeleteCourse.bind(this);

        this.state = {
            subjectsList: []
        }
    }

    componentDidMount() {
        fetch('/api/courses/' + this.props.match.params.id, {method: 'GET'})
            .then(res => res.json())
            .then(jsonRes => {

                Object.entries(jsonRes.data[0]).map(([key, values]) => {
                    if (key === 'subjects') {
                        this.setState({
                            subjectsList: values
                        });
                    }
                })
            }).catch(err => console.log(err));
    }

    onClickFindTotalAmount() {
        fetch('http://localhost:8080/courses/get-amount/' + this.props.match.params.id, {method: 'GET'})
            .then(res => res.json())
            .then(jsonRes => {
                alert(jsonRes.data);
            }).catch(err => console.log(err));
    };

    onClickDeleteCourse() {
        fetch('/api/courses/' + this.props.match.params.id, {method: 'DELETE'})
            .then(res => res.json())
            .then(jsonRes => {
                alert(jsonRes.message);
                this.props.history.push('/view-course');
            }).catch(err => console.log(err));

    }

    render() {
        return (
            <div><br/>
                <h4>Subject Details</h4><br/>
                <table className="table table-striped table-bordered ">
                    <thead>
                    <tr>
                        <th>Name</th>
                        <th>Description</th>
                        <th>Amount</th>
                    </tr>
                    </thead>
                    <tbody>

                    {
                        this.state.subjectsList.map((subject,i) => {
                            return (
                                <tr key={i}>
                                    <td>{subject.name}</td>
                                    <td>{subject.description}</td>
                                    <td>Rs.{subject.amount}</td>
                                </tr>
                            );
                        })
                    }
                    </tbody>
                </table>
                <br/>
                <hr/>
                <br/>
                <table className="table table-striped table-bordered ">
                    <thead>

                    <tr className="text-center">
                        <th>Calculate Total Amount</th>
                        <th>Delete Course</th>
                    </tr>
                    </thead>
                    <tbody>

                    <tr className="text-center">
                        <td>
                            <input type="button" value="Calculate" className="btn btn-danger"
                                   onClick={() => this.onClickFindTotalAmount()}/>
                        </td>
                        <td>
                            <input type="button" value="Delete" className="btn btn-danger"
                                   onClick={() => this.onClickDeleteCourse()}/>
                        </td>
                    </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}
